"use strict";(self.webpackChunkpsfoundation_info=self.webpackChunkpsfoundation_info||[]).push([[53],{1109:function(e){e.exports=JSON.parse('{"pluginId":"default","version":"current","label":"Next","banner":null,"badge":false,"className":"docs-version-current","isLast":true,"docsSidebars":{"tutorialSidebar":[{"type":"link","label":"Introduction","href":"/psfoundation.info/","docId":"intro"},{"type":"link","label":"Governance","href":"/psfoundation.info/governance","docId":"governance"},{"type":"link","label":"Tokenomics","href":"/psfoundation.info/tokenomics","docId":"tokenomics"},{"type":"link","label":"Communication","href":"/psfoundation.info/communication","docId":"communication"},{"type":"link","label":"Software","href":"/psfoundation.info/software","docId":"software"},{"type":"link","label":"Roadmap","href":"/psfoundation.info/roadmap","docId":"roadmap"},{"type":"link","label":"Support and Contributing","href":"/psfoundation.info/support-contribution","docId":"support-contribution"}]},"docs":{"communication":{"id":"communication","title":"Communication","description":"The PSF exists with the expectation that it will one day be threatened by a State actor. If the PSF is successful in wide adoption of its software, and stays true to its mission, then it will inevitably be threatened by a State actor. For that reason, communication channels in the PSF straddle a pragmatic approach between convenience and self-sufficiency.","sidebar":"tutorialSidebar"},"governance":{"id":"governance","title":"Governance","description":"At the highest conceptual level, the goal of PSF governance is to ensure that the people most impacted by decisions are the ones with the greatest influence over those decisions. Everything else is a detail in the attempt to achieve that ideal.","sidebar":"tutorialSidebar"},"intro":{"id":"intro","title":"Introduction","description":"The Permissionless Software Foundation is a community of JavaScript developers, entrepreneurs, and businesses. We develop and maintain business-focused cryptocurrency applications and communication software, based on the The Cash Stack. Some of our software consumes PSF tokens during operation, which allows us to maintain a circular economy with our open source contributors.","sidebar":"tutorialSidebar"},"roadmap":{"id":"roadmap","title":"Roadmap","description":"Below is a roadmap of software developed by the PSF. While it\'s easiest to present the milestones in a linear fashion, most of these goals can be achieved in parallel. Dates are never used when presenting milestones, because the PSF is not a company that can make steady progress on any one area. Most contributions come from intrinsically motivated developers who are persuing their own personal interests, and try to give back to the PSF at the same time.","sidebar":"tutorialSidebar"},"software":{"id":"software","title":"Software","description":"The core software maintained by the PSF is as follows:","sidebar":"tutorialSidebar"},"support-contribution":{"id":"support-contribution","title":"Support and Contributing","description":"Community Support","sidebar":"tutorialSidebar"},"tokenomics":{"id":"tokenomics","title":"Tokenomics","description":"The PSF token is issued primarily on the Bitcoin Cash (BCH) blockchain, using the Simple Ledger Protocol (SLP) for tokens. The Token ID below is linked to token information, including the current number of tokens in circulation:","sidebar":"tutorialSidebar"}}}')}}]);